import React from "react";
import Head from "next/head";

import Navbar from "./Navbar";

const Layout = (props) => {
  return (
    <React.Fragment>
      <div>
        <Head>
          <title>Beach Cleanup</title>
        </Head>
        <Navbar />
        {props.children}
      </div>

      <style jsx>{`
        div {
          height: 100%;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Layout;
